const Nav=()=>{
    return(
        <div>
            <div class="ui three item menu">
                <a href="/Home" class="active item">Home</a>
                <a href="/addStudent" class="item">Add Student</a>
                <a class="item">Update Student</a>
            </div>
        </div>
    )
}
export default Nav
